import React from "react";
import SearchBar from "../searchbar/SearchBar";
import styles from './nav.module.css';
import { Link } from 'react-router-dom';

function Nav(props) {
    return (
        <div className={styles.nav}>
            <div>
                <Link>About</Link>
            </div>
            <div>
                <SearchBar onSearch={props.onSearch} />
            </div>
        </div>
    )
}

export default Nav;
